function initDownloadBtns(){document.querySelectorAll(".download-btn").forEach(o=>o.addEventListener("click",async t=>{t.preventDefault();var t=o.getAttribute("data-url"),e=o.getAttribute("data-filename");try{var a=URL.createObjectURL(await(await fetch(t)).blob()),n=Object.assign(document.createElement("a"),{href:a,download:e,style:"display: none"});document.body.append(n),n.click(),n.remove(),URL.revokeObjectURL(a)}catch(e){open(t,"_blank")}}))}export{initDownloadBtns};